import { Component } from "react";

export class Colorpicker extends Component {
  state = {
    colors: this.props.colors,
  };
  render() {
    return (
      <div>
        <h2>Color Picker</h2>
        <div>
          {colors.map(({ color, label }) => (
            <span key={label} style={{ background: color }}></span>
          ))}
        </div>
      </div>
    );
  }
}
